import { Route, Switch } from "react-router-dom";
import AllQuotes from "./Pages/AllQuotes";
import QuoteDetail from "./Pages/QuoteDetail";

function App() {
  return (
    <Switch>
      <Route path="/quotes"></Route>
      <Route path="/quotes/:quoteId"></Route>
      <Route path="./new-quote"></Route>
    </Switch>
  );
}

export default App;
